import React from 'react';
import {
    BrowserRouter as Router,
    Route, Switch, Link
  } from 'react-router-dom';

function About(){
    return(
        <div>
            <Switch>
                <Link to="./About.js"></Link>
            </Switch>
        </div>
    )
}
export default About;
